import { Shape } from '@antv/g';
export function ElementOf(type) {
  return type;
}
export var Circle = ElementOf(Shape.CIRCLE);
export var Ellipse = ElementOf(Shape.ELLIPSE);
export var Group = ElementOf(Shape.GROUP);
export var HTML = ElementOf(Shape.HTML);
export var Image = ElementOf(Shape.IMAGE);
export var Line = ElementOf(Shape.LINE);
export var Path = ElementOf(Shape.PATH);
export var Polygon = ElementOf(Shape.POLYGON);
export var Polyline = ElementOf(Shape.POLYLINE);
export var Rect = ElementOf(Shape.RECT);
export var Text = ElementOf(Shape.TEXT);
